#import "VSECGGenerator.h"
@interface VSECGGenerator ()
@property (strong, nonatomic) NSArray *values;
@property NSInteger i;
@property (strong, nonatomic) NSTimer *timer;
@end

@implementation VSECGGenerator

- (instancetype)init
{
    self = [super init];
    if (self) {
        [self initDataECG];
        self.i = 0;
    }
    return self;
}

-(void)start{
    if (!self.timer){
        self.timer =[NSTimer scheduledTimerWithTimeInterval:0.1 repeats:YES block:^(NSTimer *timer) {
            [self sendNewValue];
        }];
        [[NSRunLoop mainRunLoop] addTimer: self.timer forMode:NSRunLoopCommonModes];
    }
}

-(void)stop{
    if (self.timer){
        [self.timer invalidate];
        self.timer = nil;
    }
}

-(void)sendNewValue{
    if (self.i >= self.values.count) self.i = 0;
    self.value  = self.values[self.i];
    NSLog(@"value %@" , self.value);
    self.i++;
//    self.i*=6;
}



